<!DOCTYPE html><html><head><meta charset='utf-8'><meta name='viewport' content='width=device-width, initial-scale=1'><title>Arturo/VistaChat</title><style>*{box-sizing:border-box;}:root{--arturo-primary:#f2c230;--arturo-ink:#141414;--arturo-muted:#4b4b4b;--arturo-bg:#f7f6f1;--arturo-panel:#ffffff;--arturo-border:#ded6c2;--arturo-focus:#1f1f1f;}body{font-family:'IBM Plex Sans','Segoe UI',system-ui,-apple-system,Roboto,Arial,sans-serif;margin:0;background:var(--arturo-bg);color:var(--arturo-ink);}button,input,select,textarea{font:inherit;}button{cursor:pointer;}a{color:inherit;}.vista-app-header{position:sticky;top:0;z-index:1000;background:var(--arturo-primary);color:var(--arturo-ink);border-bottom:2px solid var(--arturo-ink);}.vista-app-header-inner{max-width:1100px;margin:0 auto;padding:10px 16px;display:flex;align-items:center;gap:12px;}.vista-app-logo{height:28px;width:auto;display:block;}.vista-app-mark{font-weight:800;letter-spacing:0.2em;text-transform:uppercase;}.vista-app-title{font-size:18px;font-weight:700;}.vista-app-body{max-width:1100px;margin:0 auto;padding:16px;}.vista-row,.vista-layout-across{display:flex;gap:8px;align-items:center;flex-wrap:wrap;}.vista-col,.vista-layout-below{display:flex;flex-direction:column;gap:8px;}.vista-layout-row{display:flex;gap:8px;align-items:center;flex-wrap:wrap;}.vista-box{border:1px solid var(--arturo-border);background:var(--arturo-panel);border-radius:10px;padding:12px;}.vista-panel{border:1px solid var(--arturo-border);background:var(--arturo-panel);border-radius:12px;overflow:hidden;}.vista-panel-title{padding:8px 10px;font-weight:700;background:var(--arturo-primary);border-bottom:1px solid var(--arturo-ink);}.vista-panel-body{padding:12px;}.vista-grid{gap:8px;}.vista-spacer{min-height:8px;min-width:8px;}.vista-table{width:100%;border-collapse:collapse;background:var(--arturo-panel);}.vista-table th,.vista-table td{border:1px solid var(--arturo-border);padding:8px 10px;text-align:left;}.vista-table tbody tr:hover{background:#fbf0c2;}.vista-table tr.is-selected{background:#f7e199;}.vista-toolbar,.vista-menubar{display:flex;gap:6px;align-items:center;padding:6px 8px;background:var(--arturo-primary);border:1px solid var(--arturo-ink);border-radius:10px;}.vista-menubar{position:relative;}.vista-menu-panel{position:absolute;top:calc(100% + 4px);min-width:160px;background:var(--arturo-panel);border:1px solid var(--arturo-border);border-radius:8px;padding:6px;box-shadow:0 8px 20px rgba(0,0,0,0.12);display:none;z-index:1000;}.vista-menu-panel.is-open{display:block;}.vista-menu-item{display:block;width:100%;text-align:left;}.vista-tool-group{display:flex;gap:6px;align-items:center;}.vista-divider{border:none;border-top:1px solid var(--arturo-border);margin:8px 0;}.vista-canvas{border:1px solid var(--arturo-border);border-radius:8px;}.vista-split{display:flex;gap:8px;}.vista-split-pane{flex:1;}.vista-text-list{padding-left:18px;margin:0;}.vista-list{list-style:none;padding:0;margin:0;border:1px solid var(--arturo-border);border-radius:10px;background:var(--arturo-panel);max-height:220px;overflow:auto;}.vista-list li{padding:6px 8px;border-bottom:1px solid var(--arturo-border);cursor:pointer;}.vista-list li:last-child{border-bottom:none;}.vista-list li.is-selected{background:#f7e199;}.vista-list li.is-active{outline:2px solid var(--arturo-ink);}.vista-tabs{display:flex;flex-direction:column;gap:6px;}.vista-tabs-header{display:flex;gap:6px;flex-wrap:wrap;}.vista-tab-btn{padding:6px 10px;border:1px solid var(--arturo-border);border-radius:8px;background:var(--arturo-panel);}.vista-tab-btn.is-active{background:var(--arturo-primary);border-color:var(--arturo-ink);}.vista-tab-panel{display:none;padding:10px;border:1px solid var(--arturo-border);border-radius:10px;background:var(--arturo-panel);}.vista-tab-panel.is-active{display:block;}.vista-key{min-width:120px;}.vista-radio-group{display:flex;flex-direction:column;gap:6px;}.vista-radio-item{display:flex;align-items:center;gap:6px;}.vista-auth-splash{min-height:60vh;display:flex;align-items:center;justify-content:center;padding:24px;}.vista-auth-splash-card{max-width:520px;width:100%;text-align:center;padding:24px;border:1px solid var(--arturo-border);border-radius:14px;background:var(--arturo-panel);box-shadow:0 10px 30px rgba(0,0,0,0.08);}.vista-auth-title{font-size:28px;font-weight:800;margin:0 0 8px;}.vista-auth-subtitle{color:var(--arturo-muted);margin:0;}.vista-auth-card{max-width:520px;margin:0 auto;}.vista-auth-meta{color:var(--arturo-muted);margin-bottom:6px;}:root{--arturo-primary:#6aa3e9;--arturo-bg:#f5f4f2;--arturo-ink:#1f1f1f;}.vista-app-title{color:#1f1f1f;}</style></head><body><header class='vista-app-header'><div class='vista-app-header-inner'><img class='vista-app-logo' src='data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAuwAAAJ7CAYAAAC4Q8QHAAAACXBIWXMAAA7DAAAOwwHHb6hkAAAQAElEQVR4Aey9B6AdVbU+/q21Z+a021t6JSQhCR0UBBRQUUHAFnvvXZ8++3saey8PFR+KYgMVFJUuvfcACZ30cpPc3k+Zmb3Wf81F39+fr6jvWQjOnDMzu67y7T2zvr3PJTDyI0cgRyBHIEcgRyBHIEcgRyBHIEfgMYtATtgfs0OTG5YjsLchkNubI5AjkCOQI5AjkCPw10AgJ+x/DVRzmTkCOQI5AjkCOQI5Av97BPKeOQI5Av8PAjlh/3/gyDM5AjkCOQI5AjkCOQI5AjkCOQKPLQRywv6/H4+8Z45AjkCOQI5AjkCOQI5AjkCOwF8dgZyw/9UhzhXkCOQI5Aj8MQTy+hyBHIEcgRyBHIH/HoGcsP/32OQ1OQI5AjkCOQI5AjkCOQJ7FwK5tY9LBHLC/rgc1typHIEcgRyBHIEcgRyBHIEcgccLAjlhf7yM5N7lR25tjkCOQI5AjkCOQI5AjkCOwJ+IQE7Y/0Sg8mY5AjkCOQI5Ao9FBHKbcgRyBHIEHv8I5IT98T/GuYc5AjkCOQI5AjkCOQI5AjkCfwyBx3B9Ttgfw4OTm5YjkCOQI5AjkCOQI5AjkCOQI5AT9nwO5AjsXQjk1uYI5AjkCOQI5AjkCPyDIZAT9n+wAc/dzRHIEcgRyBHIEXgUgfyaI5AjsLcgkBP2vWWkcjtzBHIEcgRyBHIEcgRyBHIE/iEReMwT9n/IUcmdzhHIEcgRyBHIEcgRyBHIEcgR+C0COWH/LRD5LUcgR+Bxj0DuYI5AjkCOQI5AjsBeiUBO2PfKYcuNzhHIEcgRyBHIEcgR+PshkGvOEfjbIpAT9r8t3rm2HIEcgRyBHIEcgRyBHIEcgRyBPwuBnLD/WXDtXY1za3MEcgRyBHIEcgRyBHIEcgT2fgRywr73j2HuQY5AjkCOwF8bgVx+jkCOQI5AjsDfEYGcsP8dwc9V5wjkCOQI5AjkCOQI5Aj8YyGQe/u/QSAn7P8b1PI+OQI5AjkCOQI5AjkCOQI5AjkCfyMEcsL+NwI6V7N3IZBbmyOQI5AjkCOQI5AjkCPwWEEgJ+yPlZHI7cgRyBHIEcgReDwikPuUI5AjkCPwf0YgJ+z/ZwhzATkCOQI5AjkCOQI5AjkCOQI5An89BB4l7H
